css:
@-moz-document url-prefix('http://www.tumblr.com/'), url-prefix('https://www.tumblr.com/')   {

.svg-logo,
.logo .png-logo,
.logo:hover .opacity-switch .preload-container {
	background: url('http://i49.tinypic.com/1zfk7yg.png*[[logo1]]*//*[[logo2]]*/ /*[[logo3]]*/')!important;
	background-size: contain !important;
	background-repeat: no-repeat !important;
	width: 200px !important;
	height: 47px;
	/*	position: inherit; top: 5px;*/
	
	padding: 5px 0;
	margin-right: 25px;
	left: 18px;
}
.logo:hover .opacity-switch .png-logo {
	opacity: 1;
}
.opacity-switch .preload-container {
	display: none;
}
.tab_bar {
	right: 5px!important;
}
.popover_menu_item .thumb {
	right: 33px !important;
}
.search_popover * {
	box-sizing: border-box;
	width: 188px;
}
.logo .large-shadow,
.logo .small-shadow,
.logo .outer,
.logo .inner {
	display: none !important;
}
}
